import Vue from 'vue'
import Vuex from 'vuex'
import * as firebase from 'firebase'

Vue.use(Vuex)

export const store = new Vuex.Store({
  state: {
    produtos: [
      {
        id: 'Ahju112IoaFV',
        nome: 'Arroz',
        preco: 2.50,
        img: 'data:image/jpeg;base64,'
      },
      {
        id: 'Ahju1332IoaFV',
        nome: 'Camiseta',
        preco: 250.00,
        img: 'data:image/jpeg;base64,'
      },
      {
        id: 'Ahju15oaFV',
        nome: 'Calça',
        preco: 300.00,
        img: 'data:image/jpeg;base64,'
      },
      {
        id: 'A6u112IoaFV',
        nome: 'Arroz',
        preco: 2.50,
        img: 'data:image/jpeg;base64,'
      }
    ],
    user: {
      produtosComprados: ['Ahju1332IoaFV'],
      id: ''
    }
  },
  mutations: {
    cadastrarProduto (state, payload) {
      state.produtos.push(payload)
    },
    novoUser (state, payload) {
      state.user = payload
    }
  },
  actions: {
    novoProduto ({commit}, payload) {
      const produto = {
        nome: payload.nome,
        preco: payload.preco,
        img: payload.img,
        id: 'asd321654'
      }

      commit('cadastrarProduto', produto)
    },
    novoUser ({commit}, payload) {
      firebase.auth().createUserWithEmailAndPassword(payload.email, payload.senha)
        .then(
          user => {
            const novoUser = {
              id: user.user.uid,
              produtosComprados: []
            }
            commit('novoUser', novoUser)
          }
        )
        .catch(
          error => console.log(error)
        )
    }
  },
  getters: {
    produtos (state) {
      return state.produtos
    },
    produtoSelecionado (state) {
      return (produtoId) => {
        return state.produtos.find((produto) => {
          return produto.id === produtoId
        })
      }
    }
  }
})
